import { Button, Input  } from "antd";

function Signin() {
  return (
    <div id="wrapper">
      <div className="pane">
        Getch
      </div>
      <div className="auth">
        <p>Sign in</p>
        <Input/>
      </div>
      <style jsx>{`
        #wrapper {
          display: flex;
          width: 100%;
          height: 100vh;
        }

        .pane {
          display: flex;
          flex-direction: column;
          justify-content: center;
          align-items: center;
          background-color: #281742;
          flex: 1;
        }

        .auth{
          padding: 100px;;
          display: flex;
          flex-direction: column;
          justify-content: center;
          align-items: center;
          flex: 2;
        }

        .card {
          color: black;
          display: flex;
          border-radius: 4px;
          width: 30%;
          background-color: white;
          height: 100px;
        }
      `}</style>
    </div>
  );
}

Signin.Layout = (props) => <div>{props.children}</div>

export default Signin;
